const EMOJI_KEYS = ["emoji", "name"]; 
//const EMOJI_KEYS = ["emoji", "name", "code", "category", "subcategory"];
const NON_SEARHABLE_KEYS = ["emoji", "code"];

const tbl = document.querySelector("#emojis");
const tbl_body = tbl.querySelector("tbody");
const searchInput = document.querySelector("#search");
const body = document.querySelector("BODY");

const DEFAULT_EMOJI_INDEX = 1;
let emojiRowSelected = DEFAULT_EMOJI_INDEX;
let processedKeyDown = false;

function populateTableHeader(){
    tbl.querySelector("thead").appendChild(createHeaderRow(EMOJI_KEYS));
}

function init(){
    populateTableHeader();
    
    searchInput.onkeyup = onSearch;
    searchInput.onkeydown = onSearchKeydown;
    body.onkeydown = onGlobalKeydown;
    searchInput.focus();
    doSearch();
}

init();

// user interaction
function hideWindow(){
    window.picker.hide();
}

function showSettings(){
    window.picker.showSettings();
}

function onGlobalKeydown(e){
    if(e.key == "Escape") {
        console.log("ho");
        processedKeyDown = true;
        hideWindow();
    }
    else if(e.key == "," && e.metaKey) {
        console.log("hi");
        showSettings();
    }
    console.log(e);
};

function onSearchKeydown(e){
    processedKeyDown = false;
    if(e.key == "ArrowUp"){
        if(emojiRowSelected > 1) emojiRowSelected--;
        processedKeyDown = true;
        updateActiveRow(emojiRowSelected);
    }
    else if(e.key == "ArrowDown"){
        if(emojiRowSelected < tbl.querySelectorAll("tr").length - 1) emojiRowSelected++;
        processedKeyDown = true;
        updateActiveRow(emojiRowSelected);            
    }
    else if(e.key == "Enter"){
        const emoji = tbl.querySelectorAll("tr")[emojiRowSelected].querySelector("td.emoji");
        if (emoji) {
            copyEmoji(emoji.innerText);
            searchInput.focus();
            updateActiveRow(null);
        }
        processedKeyDown = true;
        searchInput.value = '';
        doSearch();
        hideWindow();
    }
}

function onSearch(e){
    if(processedKeyDown) return;

    const DELAY = 500;
    emojiRowSelected = DEFAULT_EMOJI_INDEX;
    debounce(function(){
        doSearch(e.target.value);
    }, e.target, DELAY);
}

function updateActiveRow(index){
    const activeRow = tbl.querySelector("tr.active");
    if(activeRow) activeRow.classList.remove('active');

    if(index == null) return;

    const newActiveRow = tbl.querySelectorAll("tr")[index];
    if(newActiveRow) newActiveRow.classList.add('active');
}

function debounce(fx, element, delay){
    element.setAttribute("data-debounce", (new Date()).getTime());        
    const THRESHOLD = delay - 10;
    setTimeout(function(){
        const now = (new Date()).getTime();
        const last = parseInt(element.getAttribute("data-debounce"));

        if(now - last >= THRESHOLD) {
            fx();
        }
    }, delay);
}

function copyEmoji(emoji){
    copyToClipboard(emoji);
    toastMessage(`Copied ${emoji}`);
}

function toastMessage(text){
    const toast = document.querySelector("#toast");
    toast.innerText = text;
    toast.classList.toggle("show", true);
    debounce(function(){
        toast.classList.toggle("show", false);
    }, toast, 1000);
}

function copyToClipboard(text){
    const copyText = document.querySelector("#copy");
    copyText.value = text;
    copyText.select();
    copyText.setSelectionRange(0, 99999);

    document.execCommand("copy");
}

// main logic

function matchWordsToItem(wordsToSearchFor, item, keys){
    const keysThatMatch = keys.filter(function(key){ 
        let keyValueMatchesAllSearchWords = false
        wordsToSearchFor.forEach((word,index) => {
            if(index > 0 && !keyValueMatchesAllSearchWords) return;

            const regex = new RegExp(word.replace(/(\[|\\|\^|\$|\.|\||\?|\*|\+|\(|\))/g, '\\$1'), "i");
            keyValueMatchesAllSearchWords = item[key].match(regex);
        });
        return keyValueMatchesAllSearchWords;
    });
    return keysThatMatch.length > 0 
}

function doSearch(searchString){
    if (searchString){
        const searchableKeys = EMOJI_KEYS.filter(function(key){ return !NON_SEARHABLE_KEYS.includes(key) })
        const wordsToSearchFor = searchString.split(" ");
        emojis = EMOJIS.filter(item => { 
            return matchWordsToItem(wordsToSearchFor, item, searchableKeys); 
        });
    }
    else {
        emojis = EMOJIS;
    }
    
    clear(tbl_body);
    if(emojis.length > 0) {
        emojis.forEach((emoji,index) => {
            row = createRow(emoji, EMOJI_KEYS);
            if(index+1 == emojiRowSelected) row.classList.add("active");
            tbl_body.appendChild(row);
        });
    }
    else{
        tbl_body.appendChild(createNoneRow(EMOJI_KEYS));
    }
}

// DOM

function clear(el){
    while(el.hasChildNodes()) el.children[0].remove();
}

function createNoneRow(keys){
    tr = document.createElement("tr");
    td = document.createElement("td");
    td.setAttribute("colspan", keys.length);
    td.classList.add("empty");
    td.innerText = "None found";
    tr.appendChild(td);
    return tr;
};

function createHeaderRow(keys){
    tr = document.createElement("tr");
    keys.forEach(key => {
        td = document.createElement("th");
        td.innerText = key;
        tr.appendChild(td);
    });
    return tr;
};

function createRow(data, keys){
    tr = document.createElement("tr");
    keys.forEach(key => {
        td = document.createElement("td");
        if (key == "code")
            td.innerHTML = "<code>" + data[key].join("</code><code>") + "</code>";
        else
            td.innerText = data[key];
        if (key == "emoji")
            td.classList.add("emoji");
        tr.appendChild(td);
        tr.onclick = function(){
            const emoji = this.querySelector("td.emoji");
            copyEmoji(emoji.innerText);
        };
    });
    return tr;        
}
